/* eslint-disable */

function Search(breed, typeSelect, names) {
  const queryWords = "";
  var arr = names.split(" ");

  if (typeSelect === "고양이") {
    queryWords = breed + " 고양이";
  } else {
    queryWords = breed + " 강아지";
  }

  queryWords += arr[0];
  return queryWords;
}

export default Search;
